import styled from "styled-components";
import { Link } from "react-router-dom";
import LogoIMG from "../img/new_logo_nobackground.png";

const HeaderContainer = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  height: 12rem;
  min-height: 200px;
  position: absolute;
  top: 0rem;
  border: 1px solid black;
  background-color: var(--cream);
  padding: 0 2rem;
`;

const HeaderContact = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 1rem;
`;
const MainLogo = styled.img`
  width: 190px;
  height: 190px;
  z-index: 99;
  position: absolute;
  top: 0;
  left: 0%;
`;
function Header() {
  return (
    <HeaderContainer>
      <Link to={"/"}>
        <MainLogo src={LogoIMG} alt="Main Logo" />
      </Link>
      <HeaderContact>
        <span>Social media</span>
        <span>I</span>
        <span>Y</span>
      </HeaderContact>
      <Link to={"/my_page"}>마이페이지</Link>
    </HeaderContainer>
  );
}

export default Header;
